import styles from "./Home.module.scss";

const Home = () => {
  return (
    <div className={styles.wrapper}>
      <h1>ITU Blockchain Marketplace</h1>
      <h3>Follow on Twitter: @ITUBlockchain</h3>
    </div>
  );
};

export { Home };
